import React, { Component } from 'react'
import { Link } from 'react-router-dom';

export default class Welcome extends Component {
  render() {
    return (
      <ul>
        <li><Link to='/login'>login</Link></li>
        <li><Link to='/signup'>signup</Link></li>
      </ul>
    )
  }
}
